ocumentos'),(598,'es_ES','Proethos2\\ModelBundle\\Entity\\MonitoringAction','name','7','Solicitar extensi√≥n de la aprobaci√≥n'),(599,'es_ES','Proethos2\\ModelBundle\\Entity\\MonitoringAction','name','8','Cancelaci√≥n del estudio'),(600,'es_ES','Proethos2\\ModelBundle\\Entity\\RecruitmentStatus','name','1','Reclutando'),(601,'es_ES','Proethos2\\ModelBundle\\Entity\\RecruitmentStatus','name','2','Suspendido'),(602,'es_ES','Proethos2\\ModelBundle\\Entity\\RecruitmentStatus','name','3','Completado'),(603,'es_ES','Proethos2\\ModelBundle\\Entity\\RecruitmentStatus','name','4','Otro'),(604,'es_ES','Proethos2\\ModelBundle\\Entity\\RecruitmentStatus','name','8','Pendiente'),(605,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','1','Protocolo'),(606,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','2','Otros'),(607,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','3','Decisi√≥n'),(608,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','11','Autorizaci√≥n institucional'),(609,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','27','Apoyo cient√≠fico'),(610,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','28','Bibliograf√≠a'),(611,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','29','Cuestionario'),(612,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','30','Opini√≥n'),(613,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','31','Decisi√≥n emitida por otro comit√©'),(614,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','32','Encuesta'),(615,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','33','Justificaci√≥n de dispensa del consentimiento'),(616,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','34','Material de reclutamiento/informaci√≥n del participante'),(617,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','35','P√≥liza de seguro'),(618,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','36','Estimaci√≥n'),(619,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','37','Protocolo con animales'),(620,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','38','Reporte de evento adverso'),(621,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','39','Resumen ejecutivo'),(622,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','40','Consentimiento informado'),(623,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','41','Protocolo'),(624,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','42','Opini√≥n'),(625,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','question','1','¬øQu√© est√° sujeto a revisi√≥n √©tica?'),(626,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','answer','1','<p>Toda\ninvestigaci√≥n con seres humanos debe obtener aprobaci√≥n √©tica por parte de un\ncomit√© de revisi√≥n √©tica antes de iniciarse. Para constituir investigaci√≥n con\nseres humanos la propuesta debe ser una investigaci√≥n y debe obtener\ninformaci√≥n de personas.</p>\n\n<p>La investigaci√≥n\nse define como la actividad de ciencias sociales, biom√©dicas, del\ncomportamiento o epidemiol√≥gica que implica recabar o analizar datos\nsistem√°ticamente con el objetivo de desarrollar conocimiento generalizable. Se\ndefine a seres humanos como personas que que (i) se vuelven identificables\nindividualmente por la recolecci√≥n, preparaci√≥n o uso de material biol√≥gico o\nrecords m√©dicos o de otro tipo, o (ii) est√°n expuestos a la manipulaci√≥n,\nintervenci√≥n, observaci√≥n u otra interacci√≥n con los investigadores\ndirectamente o por medio de la alteraci√≥n de su entorno.</p>\n\n<p>La investigaci√≥n\ncon seres humanos incluye estudios que usan tejidos, muestras, datos u otros\nrecords de personas, as√≠ como estudios que involucran la conducci√≥n de\nentrevistas, grupos focales o encuestas, o la observaci√≥n del comportamiento\nprivado.</p>\n\n<p>Las actividades\nque no constituyen investigaci√≥n con seres humanos est√°n exentas de revisi√≥n\n√©tica. Estas pueden ser actividades que no buscan la producci√≥n de conocimiento\ngeneralizable o no involucran a seres humanos en las maneras descritas. Por\nejemplo, las siguientes actividades no constituyen investigaci√≥n con seres\nhumanos y est√°n por ello exentas de revisi√≥n √©tica:</p>\n\n<ul><li>Estudios que\nutilizan datos que est√°n disponibles p√∫blicamente o son generados por la\nobservaci√≥n de comportamiento p√∫blico.</li></ul>\n\n<ul><li>Estudios que\nusan datos, muestras o tejidos ya existentes (previamente obtenido por otros)\nque son recibidos por los investigadores de manera tal que la identidad de los\nindividuos no puede ser establecida.</li></ul>\n\n<ul><li>Actividades de\nsalud p√∫blica llevadas a cabo por la autoridad reconocida de salud p√∫blica con\nel objetivo de prevenir o controlar una enfermedad o da√±o, incluidas\nactividades de vigilancia que buscan solo identificar o controlar un problema\nde salud. Estas son actividades que buscan el beneficio de los participantes o\nlas comunidades de los participantes, y no buscan generar conocimiento que es\naplicable a otras poblaciones.</li></ul>\n\n<ul><li>Actividades de\ncontrol de calidad o evaluaciones de programas que buscan mejorar el programa\nen cuesti√≥n y sin intenci√≥n de producir conocimiento generalizable.</li></ul>\n\n<p>Hay proyectos que\npueden tener m√∫ltiples componentes, algunos de los cuales pueden constituir\ninvestigaci√≥n con seres humanos mientras que otros pueden no serlo. El\ncomponente que constituye investigaci√≥n con seres humanos debe pasar por\nrevisi√≥n √©tica. La determinaci√≥n de si una propuesta no est√° exenta de revisi√≥n\n√©tica la debe hacer una parte independiente, como un comit√© de revisi√≥n √©tica.</p>'),(627,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','question','2','¬øQu√© pautas √©ticas internacionales gobiernan la investigaci√≥n con humanos?'),(628,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','answer','2','<ul><li>Declaraci√≥n de\nHelsinki de la Asociaci√≥n M√©dica Mundial (revisi√≥n del 2013): <a href=\"http://www.iacs.aragon.es/econocimiento/documentos/ceica/2013-declaracion-helsinki-brasil.pdf\" rel=\"nofollow\" target=\"_blank\">http://www.iacs.aragon.es/econocimiento/documentos/ceica/2013-declaracion-helsinki-brasil.pdf</a>\n</li></ul>\n\n<ul><li>Pautas √©ticas\ninternacionales para la investigaci√≥n biom√©dica en seres humanos del Consejo de\nOrganizaciones Internacionales de las Ciencias M√©dicas (CIOMS): <a href=\"http://www.cioms.ch/publications/guidelines/pautas_eticas_internacionales.htm\" rel=\"nofollow\" target=\"_blank\">http://www.cioms.ch/publications/guidelines/pautas_eticas_internacionales.htm</a>\n</li></ul>\n\n<ul><li>Pautas\ninternacionales para la evaluaci√≥n √©tica de los estudios epidemiol√≥gicos del\nCIOMS: <a href=\"http://www.ms.gba.gov.ar/sitios/ccis/files/2012/08/PAUTASINTERNACIONALESEVALUACIONETICAESTUDIOSEPIDEMIOLOGICOS1991.pdf\" rel=\"nofollow\" target=\"_blank\">http://www.ms.gba.gov.ar/sitios/ccis/files/2012/08/PAUTASINTERNACIONALESEVALUACIONETICAESTUDIOSEPIDEMIOLOGICOS1991.pdf</a>\n</li></ul>'),(629,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','question','3','¬øCu√°les son los est√°ndares de cada pa√≠s para la investigaci√≥n con seres humanos?'),(630,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','answer','3','<ul><li>Compilaci√≥n\ninternacional de est√°ndares para la investigaci√≥n con seres humanos (edici√≥n\ndel 2015): <a href=\"http://www.hhs.gov/ohrp/international/index.html\" rel=\"nofollow\" target=\"_blank\">http://www.hhs.gov/ohrp/international/index.html</a></li></ul>'),(631,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','question','4','¬øC√≥mo debe funcionar un comit√© de revisi√≥n √©tica de la investigaci√≥n con seres humanos?'),(632,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','answer','4','Pautas\ny orientaci√≥n operativa para la revisi√≥n √©tica de la investigaci√≥n en salud con\nseres humanos publicadas por OPS/OMS: <a href=\"http://www.paho.org/hq/index.php?option=com_docman&amp;task=doc_view&amp;Itemid=270&amp;gid=22738&amp;lang=es\" rel=\"nofollow\" target=\"_blank\">http://www.paho.org/hq/index.php?option=com_docman&amp;task=doc_view&amp;Itemid=270&amp;gid=22738&amp;lang=es</a> <br>'),(633,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','question','5','¬øQu√© preguntas deben guiar la revisi√≥n √©tica de la investigaci√≥n con seres humanos?'),(634,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','answer','5','<ul><li>Valor social:\n¬øPuede el estudio llevar a mejoras en la salud o el bienestar? ¬øCu√°l es el\nvalor potencial de la investigaci√≥n para cada uno de los posibles\nbeneficiarios?</li></ul><ul><li>Validez\ncient√≠fica: ¬øEs la investigaci√≥n metodol√≥gicamente v√°lida y cient√≠fica (y\nestad√≠sticamente) s√≥lida? ¬øVa el estudio a generar datos v√°lidos y confiables\nque puedan ser generalizables? ¬øEs viable? ¬øPermite el dise√±o del estudio dar a\nlos participantes aquellos servicios de salud que les corresponden? Si no es el\ncaso, ¬øhay razones metodol√≥gicas poderosas para no hacerlo y se protege a los\nparticipantes de da√±os serios?</li></ul>\n\n<ul><li>Selecci√≥n justa\nde participantes: ¬øCu√°les son los criterios para incluir y excluir participantes?\n¬øSe basa la selecci√≥n en criterios cient√≠ficos? ¬øSe selecciona a participantes\nde manera que se minimicen los riesgos y se maximicen los beneficios\npotenciales? Si los participantes son vulnerables, ¬øhay salvaguardas para\nprotegerlos? ¬øSe distribuyen los riesgos y potenciales beneficios del estudio\nde manera equitativa?</li></ul>\n\n<ul><li>Balance favorable\nde riesgos y beneficios: ¬øPueden minimizarse los riesgos para los\nparticipantes? ¬øPueden mejorarse los beneficios potenciales para los individuos\ny la sociedad? ¬øSon los beneficios potenciales para la sociedad y los\nindividuos superiores a los riesgos?</li></ul>\n\n<ul><li>Consentimiento\ninformado: ¬øSe da a los potenciales participantes la informaci√≥n acertada,\nclara, relevante y completa? ¬øSon los procedimientos de reclutamiento, el proceso\nde consentimiento y los incentivos apropiados para la cultura y el contexto?\n¬øHay un plan apropiado para obtener la autorizaci√≥n de quienes no pueden\nconsentir por si mismos? ¬øSe aclara a los participantes que tienen derecho a no\nparticipar? ¬øSon libres de no participar?</li></ul>\n\n<ul><li>Respeto por los\nparticipantes: ¬øC√≥mo se va a monitorear la salud y el bienestar de los\nparticipantes para minimizar da√±os? ¬øC√≥mo se va a proteger su privacidad?\n¬øPueden retirarse del estudio sin represalias? ¬øCu√°les son los planes de atenci√≥n\nluego de terminado el estudio? ¬øSe les va a dar a los participantes cualquier\nnueva informaci√≥n (incluidos los resultados del estudio)?</li></ul>\n\n<p>(Adaptado de (1) Emanuel E, Wendler D, Grady C. An ethical\nframework for biomedical research. In: Emanuel E et al. eds. The Oxford\ntextbook of clinical research ethics. New York, NY: Oxford University Press;\n2008: 123-135. (2) Emanuel E, Wendler D, Grady C. What makes clinical research\nethical? JAMA 2000;283:2701-27711. (3) Emanuel E, Wendler D, Killen J, Grady C.\nWhat makes clinical research in developing countries ethical? The benchmarks of\nethical research. JID 2004;189:930-937.)</p>\n\n<br><br><br><br>'),(635,'pt_BR','Proethos2\\ModelBundle\\Entity\\Help','message','1','Breve resumo do protocolo '),(636,'pt_BR','Proethos2\\ModelBundle\\Entity\\Help','message','2','Palavras-chave referentes ao protocolo, separado por v√≠rgulas'),(637,'pt_BR','Proethos2\\ModelBundle\\Entity\\Help','message','3','Informa√ß√µes de introdu√ß√£o do protocolo '),(638,'pt_BR','Proethos2\\ModelBundle\\Entity\\Help','message','4','Justifica√ß√£o do estudo '),(639,'pt_BR','Proethos2\\ModelBundle\\Entity\\Help','message','5','Objetivos do estudo '),(640,'pt_BR','Proethos2\\ModelBundle\\Entity\\Help','message','13','E esta apresenta√ß√£o de um ensaio cl√≠nico? '),(641,'pt_BR','Proethos2\\ModelBundle\\Entity\\Help','message','14','T√≠tulo cient√≠fico do p