INSERT INTO `faq` VALUES (1,'2016-08-23 14:01:13','2016-08-23 14:01:13',1,'What is subject to ethics review?','<p>All research with human subjects should obtain ethics\r\napproval from a research ethics committee prior to its initiation. To meet the\r\ndefinition of research with human subjects, the proposal must constitute\r\nresearch and it must obtain information from human subjects. Research is\r\ndefined as any social science, biomedical, behavioral, or epidemiological\r\nactivity that entails systematic collection or analysis of data, with the\r\nintent to develop generalizable knowledge. Human subjects are defined as human\r\nbeings (i) who become individually identifiable through investigator‚Äôs\r\ncollection, preparation, or use of biological material or medical or other\r\nrecords, or (ii) who are exposed to manipulation, intervention, observation, or\r\nother interaction with investigators either directly or through alteration of\r\ntheir environment. Research with human subjects includes studies that use\r\ntissues, samples, data or records from humans, as well as studies that involve\r\nthe conduction of interviews, focus groups or surveys, or the observation of\r\nprivate behavior.</p>\r\n\r\n<p>Activities that do not constitute research with human\r\nsubjects are exempted from ethics review. These are activities that do not aim\r\nat the production of generalizable knowledge or do not involve human subjects\r\nin the ways described above. For example, the following activities do not\r\nconstitute research with human subjects and are thus exempted from ethics\r\nreview:</p>\r\n\r\n<ul><li>Studies using data that are publicly available or\r\ngenerated by observation of public behavior.</li></ul>\r\n\r\n<ul><li>Studies using data, samples, or tissue that already exist\r\n(i.e. the data, samples or tissue have been obtained by others) and are\r\nreceived by the research team in such a manner that the identity of the\r\nindividuals cannot be established.</li></ul>\r\n\r\n<ul><li>Public health activities conducted under recognized public\r\nhealth authority with the intent to prevent or control of disease or injury,\r\nincluding surveillance activities aimed only at the identification or control\r\nof a health problem. These are activities that seek the benefit of the\r\nparticipants or the participants‚Äô communities, and do not intend to generate\r\nknowledge that is applicable to other populations.</li></ul>\r\n\r\n<ul><li>Quality assurance activities or program evaluations aimed\r\nat improving the program at stake, and with no intent to produce generalizable\r\nknowledge.</li></ul>\r\n\r\n<p>Projects might involve multiple components, some of which\r\nmight constitute research with human subjects while other components might not.\r\nThe components that constitute research with human subjects should undergo\r\nethics review. Determinations about whether a proposal is exempted from ethics\r\nreview should be made by an independent party such as an ethics review\r\ncommittee.</p>'),(2,'2016-08-23 14:01:48','2016-08-23 14:01:48',1,'What are the international ethical guidelines for research with human subjects?','<ul><li>Declaration of Helsinki of the World Medical Association\r\n(2013 revision): <a href=\"http://www.wma.net/en/30publications/10policies/b3/\" rel=\"nofollow\" target=\"_blank\">http://www.wma.net/en/30publications/10policies/b3/</a>\r\n</li></ul>\r\n\r\n<ul><li>International Ethical Guidelines for Biomedical Research\r\nInvolving Human Subjects of the Council for International Organizations of\r\nMedical Sciences (CIOMS): <a href=\"http://www.cioms.ch/publications/guidelines/guidelines_nov_2002_blurb.htm\" rel=\"nofollow\" target=\"_blank\">http://www.cioms.ch/publications/guidelines/guidelines_nov_2002_blurb.htm</a>\r\n</li></ul>\r\n\r\n<ul><li>International Guidelines for Ethical Review of\r\nEpidemiological Studies of the Council for International Organizations of\r\nMedical Sciences (CIOMS): <a href=\"http://www.cioms.ch/publications/guidelines/1991_texts_of_guidelines.htm\" rel=\"nofollow\" target=\"_blank\">http://www.cioms.ch/publications/guidelines/1991_texts_of_guidelines.htm</a>\r\n</li></ul>'),(3,'2016-08-23 14:02:10','2016-08-23 14:02:10',1,'What are the standards of each country for research with human subjects?','<ul><li>International\r\nCompilation of Human Research Standards (2015 edition): <a href=\"http://www.hhs.gov/ohrp/international/index.html\" rel=\"nofollow\" target=\"_blank\">http://www.hhs.gov/ohrp/international/index.html</a>\r\n</li></ul>'),(4,'2016-08-23 14:02:31','2016-08-23 14:02:31',1,'How should ethics review committees function?','<ul><li>Standards\r\nand Operational Guidance for Ethics Review of Health-Related Research with\r\nHuman Participants published by WHO: <a href=\"http://whqlibdoc.who.int/publications/2011/9789241502948_eng.pdf?ua=1\" rel=\"nofollow\" target=\"_blank\">http://whqlibdoc.who.int/publications/2011/9789241502948_eng.pdf?ua=1</a></li></ul>'),(5,'2016-08-23 14:04:01','2016-08-23 14:04:01',1,'Which questions should guide the ethics review of research with human subjects?','<ul><li>Social value: Can the study lead to improvements in health\r\nor well-being? What is the potential value of the research for each of the\r\nprospective beneficiaries?</li></ul>\r\n\r\n<ul><li>Scientific validity: Is the investigation methodologically\r\nvalid and scientifically (and statistically) sound? Will the study generate\r\nvalid and reliable data that can be generalizable? Is the study feasible? Does\r\nthe study design ensure participants the health-care interventions they are\r\nentitled to? If not, are there methodologically compelling reasons and are\r\nparticipants protected from serious harm?</li></ul>\r\n\r\n<ul><li>Fair participant selection: What are the criteria to include\r\nand exclude participants? Is selection of participants based on scientific\r\ncriteria? Are research participants selected to minimize risks and maximize\r\npotential benefits? If participants are vulnerable, are there any safeguards to\r\nprotect them? Are the risks and potential benefits of the study fairly\r\ndistributed?</li></ul>\r\n\r\n<ul><li>Favorable risk-benefit ratio: Can the risks for participants\r\nbe minimized? Can potential benefits for individuals and society be improved?\r\nDo the potential benefits for society and individuals outweigh the risks?</li></ul>\r\n\r\n<ul><li>Informed consent: Is the information provided to potential\r\nparticipants accurate, clear, relevant and complete? Are the recruitment\r\nprocedures, consent process and incentives appropriate for their culture and\r\ncontext? Is there an appropriate plan for obtaining permission for those that\r\ncan‚Äôt consent for themselves? Are the participants being made aware of their\r\nright to refuse to participate and are they actually free to refuse?</li></ul>\r\n\r\n<ul><li>Respect for participants: How will the health and well-being\r\nof participants be monitored to minimize harms? How will their privacy be\r\nprotected? Can participants withdraw from the study without penalty? What are\r\nthe plans of care after the study is completed? Will participants be given any\r\nnew information (including the results of the study)?</li></ul>\r\n\r\n<p>(Adapted from (1) Emanuel E, Wendler D, Grady C. An ethical\r\nframework for biomedical research. In: Emanuel E et al. eds. The Oxford\r\ntextbook of clinical research ethics. New York, NY: Oxford University Press;\r\n2008: 123-135. (2) Emanuel E, Wendler D, Grady C. What makes clinical research\r\nethical? JAMA 2000;283:2701-27711. (3) Emanuel E, Wendler D, Killen J, Grady C.\r\nWhat makes clinical research in developing countries ethical? The benchmarks of\r\nethical research. JID 2004;189:930-937.)</p>\r\n\r\n<br><br><br><br>');
